"original": |2-
     o  Each Job is identified by a numeric identifier, which is a 32-bit
        positive integer.  The Job's "job-id" attribute contains the
        Job ID.  The Job ID is only unique within the context of the
        Printer that created the Job.
"fixed": |-
  -  Each Job is identified by a numeric identifier, which is a 32-bit positive integer.  The Job's "job-id" attribute contains the Job ID.  The Job ID is only unique within the context of the Printer that created the Job.
"ko": |-
  - 각 작업은 32비트 양의 정수인 숫자 식별자로 식별됩니다. 작업의 "job-id" 속성에는 작업 ID가 포함되어 있습니다. 작업 ID는 작업을 생성한 프린터의 컨텍스트 내에서만 고유합니다.
